import React from 'react';
import {Avatar} from "@material-ui/core";
function Sidebar() {
    return (
        <div className="sidebar">
            <div className="side_header">
            <Avatar />
            </div>
            <div className="side_search">
            </div>
            <div className="side_list">
            </div>
        </div>
    )
}

export default Sidebar
